import './videoPlayer.css'

export default function VideoPlayer({videoID}) {
    return (
        <div className="videoPlayer">
            <iframe width='420' height='315' src={`http://youtube.com/embed/${videoID}`} frameborder='0' allowFullScreen></iframe>
        </div>
    )
}
